import React from 'react';
import Imglogo from '../../assets/img/logo.png';
const Footer = () => {
    return (
        <div>
            <footer>
                <div class="m-20">
                    <hr />
                    <img src={Imglogo} alt="" />
                </div>
            </footer>
        </div>
    );
};

export default Footer;
